import Card1 from './assets/image1.png'
import Card2 from './assets/wedding-photography.png'
import { FaStar } from "react-icons/fa";

class airbnbInfo {
    constructor(name, rating, country, price, available, img) {
      this.name = name;
      this.rating =  rating;
      this.country = country;
      this.price = price;
      this.available = available;
      this.img = img
    }
  }


  function Card(props) {
      console.log(props)
      console.log(props.cardInfo.available)
      return (
          <div className='card-component shadow-lg p-4 rounded mx-3 my-5'>
                <span className='soldout-text px-2 m-3'>{props.cardInfo.available}</span>
                <img src={Card1} className='card-image shadow-lg'></img>
                <span><FaStar className='star'/>5.0 (6) USA</span>
                <br></br>
                <span>Life Lessons from Zate</span>
                <br></br>
                <span><b>From 123$</b> / person</span>
            </div>
    )
}

function CardList(){
    let card1 = new airbnbInfo('Life Lessons from Zate', '5.0', 'USA', '123', 'SoldOut', Card1);
    let card2 = new airbnbInfo('Wedding Photography', '4.5', 'Switserland', '250', 'Online', Card2);
    return(
        <div>
            <Card cardInfo = {card1}/>
            <Card cardInfo = {card2}/>
            <Card cardInfo = {card2}/>
      </div>
    )
}

export {CardList};
